import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from '/media/hp/107 GB Volume/WebDev/Projects/giftbazar/src/Pages/Home.js';
import ComingSoon from '/media/hp/107 GB Volume/WebDev/Projects/giftbazar/src/Pages/ComingSoon.js';
import Contact from './Contact';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/BuyNow" component={ComingSoon} />
      </Switch>
    </Router>
  );
}

export default App;
